"203413":{"id":"203413","name":"Minha Lady Jane","slug":"minha-lady-jane","original_title":"My Lady Jane","overview":"Prepare-se para a trágica história de Lady Jane Grey, a jovem nobre Tudor que foi Rainha da Inglaterra por nove dias e depois decapitada em 1553... F*da-se. Estamos recontando a história como deveria ter acontecido: a donzela em perigo se salva. Este é um conto épico de amor verdadeiro e grandes aventuras ambientado em um universo alternativo de ação, história, fantasia, comédia e romance. Preparar-se.","first_air_date":"2024-06-27","episode_run_time":0,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Gemma Burgess"],"production_companies":["Parkes+MacDonald Image Nation","Picrow","Amazon MGM Studios"],"genres":["Drama","Comédia","Sci-Fi & Fantasy"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/oRxMRPh7MEV7blqBDq07sQWG0bY.jpg","poster_path":"https://image.tmdb.org/t/p/original/2I5oLaiqHebguFGgDpUh7D6XmIF.jpg","cast":["Emily Bader","Edward Bluemel","Anna Chancellor","Rob Brydon","Kate O'Flynn"],"trailer":"rs6b3EfGJTw","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/2I5oLaiqHebguFGgDpUh7D6XmIF.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/2I5oLaiqHebguFGgDpUh7D6XmIF.jpg","air_date":"2024-06-27","episode_count":8,"overview":"N/A","vote_average":5.7,"episodes":{"1":{"name":"Episódio 1","overview":"Esta é a Lady Jane Grey. Brilhante, mas também linda, o que é mais útil. Ela está prestes a ter o pior dia de sua vida.","air_date":"2024-06-27","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/tfJVVrrgYAfIw2QVrDF3qZ7LroY.jpg","vote_average":5.6},"2":{"name":"Episódio 2","overview":"O que é pior: quando você é alvo da fúria de um canalha absoluto? Ou quando ele tem um segredo obscuro que pode matar vocês dois?","air_date":"2024-06-27","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/gvKbUXAMWGILeshzvv0kNdmizsv.jpg","vote_average":5.7},"3":{"name":"Episódio 3","overview":"Missões noturnas na floresta, pancadaria, festas, duelos, assassinatos e beijos. Este episódio tem de tudo.","air_date":"2024-06-27","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/9pJQKVeghM6wV9f7Pez50bU6vZB.jpg","vote_average":5.6},"4":{"name":"Episódio 4","overview":"Jane é a rainha, e as pessoas continuam tentando matá-la. Passe o vinho.","air_date":"2024-06-27","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/xX2XeeYSPrX7ddUsDSWIleEVceW.jpg","vote_average":5.6},"5":{"name":"Episódio 5","overview":"Maria vem atrás da coroa de Jane. Frances vem atrás de Guildford. E a nobreza está chegando para ficar de pileque Banquete da Coroação de Jane.","air_date":"2024-06-27","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/udKUEMB3SNcqmPEEKlUvnFLYCID.jpg","vote_average":5.6},"6":{"name":"Episódio 6","overview":"Desaparecido: o consorte rebelde da rainha da Inglaterra. Se tiver alguma ideia do paradeiro dele, avise-nos.","air_date":"2024-06-27","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/bitudV3GBc4X3uP51j5shWxTkyt.jpg","vote_average":5.6},"7":{"name":"Episódio 7","overview":"Jane está sendo julgada por traição. E Guildford, Eduardo e Fitz estão determinados a salvá-la. Típico dos homens.","air_date":"2024-06-27","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/j3BTBtTm42EAmBkisuPcWGWeWSV.jpg","vote_average":5.6},"8":{"name":"Episódio 8","overview":"Nossa intrépida heroína pode perder a cabeça... mas não perderá a calma.","air_date":"2024-06-27","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/u6oSuN5snGzYlxElWnLn5srEOR9.jpg","vote_average":6}}}}},
