"96417":{"id":"96417","name":"Nos Campos Do Holocausto","slug":"nos-campos-do-holocausto","original_title":"Nos Campos Do Holocausto","overview":"Conheça a história de superação dos sobreviventes do Holocausto, da Segunda Guerra Mundial, que vivem no Brasil.","first_air_date":"2015-01-11","episode_run_time":0,"vote_average":0,"number_of_seasons":2,"number_of_episodes":11,"created_by":["Carla Albuquerque","Beto Ribeiro"],"production_companies":["Medialand"],"genres":["Documentário","War & Politics"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/eGimhInjF1zAwJg3WodGDf4x4lD.jpg","poster_path":"https://image.tmdb.org/t/p/original/70RPv3HkitN0nQheFXP7sQoazrm.jpg","cast":[],"trailer":"4pjDoib5PT4","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/d2GAV4bFBvatWg7WK96ljkFOLpS.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/d2GAV4bFBvatWg7WK96ljkFOLpS.jpg","air_date":"2015-01-10","episode_count":8,"overview":"Conheça as histórias dos sobreviventes do Holocausto, da Segunda Guerra Mundial, que vivem no Brasil.","vote_average":0,"episodes":{"1":{"name":"Miriam e Ben","overview":"Acompanhe a emocionante história de vida do casal Miriam Brik e Ben Abraham. Nascidos na Polônia na época da guerra, ambos sofreram preconceitos e perdas, mas foi no Brasil que se encontraram e formaram uma família.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/jo4JhWsEiapJPcpuEgcIjOj0CCl.jpg","vote_average":0},"2":{"name":"Nanette Konig","overview":"Nanette Konig nasceu em Amsterdã, na Holanda, e viu os alemães invadirem seu país. Acompanhe as memórias de uma sobrevivente dos campos de concentração que perdeu sua família e sua casa durante a guerra.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/coafCri5GK3Mqev8vrxRAxeiPoL.jpg","vote_average":0},"3":{"name":"Rita Braun","overview":"Rita Braun é polonesa, judia e morou com sua mãe em um dos guetos alemães. Ela lembra como era sua vida, e como conseguiu se salvar do genocídio.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/h2ZwiC2JkwFti0jp6FXV7hPTeXd.jpg","vote_average":0},"4":{"name":"Lola Anglister","overview":"Conheça Lola Anglister, uma polonesa que quando jovem passou por três campos de concentração, entre eles Auschwitz. Ela conta sobre sua família e como era viver com medo todos os dias.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/e7ZwXUpxXsvll9pu7rWE2JRN9cE.jpg","vote_average":0},"5":{"name":"Michel Dymetman","overview":"De acordo com o próprio Michel Dymetman, que nasceu na capital polonesa em 1924, ter sobrevivido ao Holocausto foi um milagre. Conheça a história de sua família e como eles viviam naquela época.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/nIi2UrzBJ9TEncZSUZmuLoeFmUx.jpg","vote_average":0},"6":{"name":"Hana Jurika","overview":"Hana Jurika nasceu em Lodz na Polônia e viu sua cidade se transformar em um gueto para judeus. Ela, que também passou por Auschwitz, descreve as tristes histórias que viveu.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/vZYQzFlnrNVZ0PaK9RgggfzB7n9.jpg","vote_average":0},"7":{"name":"Ernesto Strauss","overview":"Nascido em uma família modesta de Frankfurt na Alemanha, Ernesto Strauss conta que sofreu preconceitos e ameaças desde a época de infância até a ascensão nazista.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/aBPZWiEBEmqgY5InI5qL7ShAM0Y.jpg","vote_average":0},"8":{"name":"Kiwa Kozuchowicz","overview":"Kiwa Kozuchowicz nasceu na Polônia e relembra a pior viagem de sua vida: de trêm até o campo de concentração de Auschwitz. Sua filha, Rosana Kozuchowicz, conta o que soube do Holocausto através de seu pai.","air_date":"2015-01-11","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/3GFMS1g9zxXFnC1FyngtQRaqzjv.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/eXmcafhUWE87AZUdxZO07IfKC0N.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eXmcafhUWE87AZUdxZO07IfKC0N.jpg","air_date":"2021-04-07","episode_count":3,"overview":"Conheça novas histórias dos sobreviventes do Holocausto, da Segunda Guerra Mundial, que vivem no Brasil.","vote_average":0,"episodes":{"1":{"name":"Episódio 1","overview":"O romeno Joshua Strul nasceu em 1933, mesmo ano em que Hitler chegou ao poder na Alemanha como chanceler do Reich. Em 1942, Joshua e sua família são obrigados a irem para Bacau e enfrentarem o inverno rigoroso da região em condições precárias de existência. Confinados, eles lutam por sobrevivência e aguardam ordem para irem até a estação ferroviária.","air_date":"2021-04-07","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/4C4Mai6eLUFjB7W1uDffON5J0SR.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Veja a história de Irene G. Freudenheim, que conseguiu fugir da Alemanha nazista com sua família e se refugiou no Uruguai, de onde acompanhavam pela rádio todo terror que acontecia na Europa e com todos os seus parentes que não conseguiram sair e aos poucos eram massacrados.","air_date":"2021-04-14","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/4C4Mai6eLUFjB7W1uDffON5J0SR.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Em 1941 as deportações de todos os judeus acontecem na Tchecoslováquia e a família de Karel Roubicek é enviada para o gueto e, em seguida, para o campo de concentração de Theresienstadt. Alguns anos depois, em 1944, sua família se separa e ele, seu irmão e seu pai são enviados para Auschwitz, na Polônia. Logo, eles entendem o que era a fuligem constante que saía das chaminés.","air_date":"2021-04-21","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/4C4Mai6eLUFjB7W1uDffON5J0SR.jpg","vote_average":0}}}}},
