"154259":{"id":"154259","name":"Praias e Pratos com Vitor Liberato","slug":"praias-e-pratos-com-vitor-liberato","original_title":"Praias e Pratos com Vitor Liberato","overview":"Vitor Liberato viaja pelo Nordeste para conhecer comidas tradicionais, como Paçoca de Pilão, mas também novas misturas como a Batata com Wasabi do restaurante Tapas. Vitor faz um road trip entre Pernambuco e Rio Grande do Norte, visitando lugares emblemáticos do Nordeste, como o maior cajueiro do mundo e as dunas de Genipabu.","first_air_date":"2016-01-04","episode_run_time":7,"vote_average":0,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["Tastemade"],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/originalnull","poster_path":"https://image.tmdb.org/t/p/original/hdKpTICiHxaZIqnbl3SQXAgULsX.jpg","cast":["Vitor Liberato"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/hdKpTICiHxaZIqnbl3SQXAgULsX.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/hdKpTICiHxaZIqnbl3SQXAgULsX.jpg","air_date":"2016-01-04","episode_count":10,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Chegando em Natal","overview":"Mesmo chegando em Natal à noite, Vitor Liberato quer explorar e provar a comida nordestina que tanto ouviu falar. No primeiro episódio de Praias e Pratos, Vitor visita a Casa do Matuto e vai surfar em Ponta Negra.","air_date":"2016-01-04","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"2":{"name":"Ponta Negra e Genipabu","overview":"Vitor Liberato explora as dunas de Genipabu em um buggy e fala com a senhora Dalva, dona do restaurante Paçoca de Pilão.","air_date":"2016-01-11","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Natal, Farol Bar e Genipabu","overview":"Vitor Liberato vai para o último restaurante em Natal, o Farol Bar, e continua explorando as dunas de Genipabu de buggy e tirolesa!","air_date":"2016-01-18","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Chegando na Praia da Pipa","overview":"Vitor Liberato visita o maior cajueiro do mundo e se prepara para a viagem para Praia da Pipa. Durante o primeiro dia em Praia da Pipa, Vitor explora a praia dos golfinhos e visita um dos melhores lugares para comer: o Tapas Restaurante!","air_date":"2016-01-25","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Baía Formosa e Praia do Amor","overview":"Vitor Liberato visita praias incríveis com lugares de tirar o fôlego. Depois, experimenta pratos deliciosos e vai surfar na Praia do Amor.","air_date":"2016-02-01","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"Porto de Galinhas e a Melhor Tapioca","overview":"Vitor faz uma viagem estilo \"road trip\" e chega em Porto de Galinhas. No primeiro dia, ele visita as praias que formam piscinas naturais e prova a melhor tapioca da cidade!","air_date":"2016-02-08","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"7":{"name":"Pontal de Maracaípe e Jangadeiros","overview":"Nesse episódio, o passeio é com os jangadeiros! Vitor mergulha, visita um restaurante no mangue e come Cioba, um peixe nativo da região.","air_date":"2016-02-15","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"8":{"name":"Praia dos Carneiros","overview":"Vitor faz mais uma road trip e chega à Praia dos Carneiros, onde pega uma pequena lancha para conhecer as ilhas. Para encerrar o dia, ele visita o restaurante Arikindá e prova um peixe recheado com camarão.","air_date":"2016-02-22","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"9":{"name":"Recife Antigo","overview":"Vitor chega a Recife e visita o Paço de Frevo, um espaço dedicado à difusão, lazer e formação nas áreas de dança e música do frevo. À noite, conhece o restaurante Ponte Nova, que tem um toque francês misturado a ingredientes regionais.","air_date":"2016-02-29","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"10":{"name":"Olinda e Oficina do Sabor","overview":"Vitor almoça na Oficina do Sabor e conhece o chef César Santos. Para fechar a série, Vitor anda pelas ruas de Olinda e relembra um pouco da viagem.","air_date":"2016-03-07","runtime":7,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
