"110529":{"id":"110529","name":"Cidade Invisível","slug":"cidade-invisivel","original_title":"Cidade Invisível","overview":"Ao investigar um assassinato, um detetive se envolve em uma batalha entre o mundo visível e um reino subterrâneo habitado por criaturas folclóricas.","first_air_date":"2021-02-05","episode_run_time":36,"vote_average":7.131,"number_of_seasons":2,"number_of_episodes":12,"created_by":["Carlos Saldanha","Mirna Nogueira","Rodrigo Nogueira"],"production_companies":["Pródigo Filmes"],"genres":["Mistério","Drama","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/lXzu1IZmzDulGeqqrknoE7c5hak.jpg","poster_path":"https://image.tmdb.org/t/p/original/u9bQPxILScuQCZPV1clEYxqFTL8.jpg","cast":["Marco Pigossi","Alessandra Negrini","Julia Konrad","Manuela Dieguez","Leticia Spiller"],"trailer":"GodwQKNXIYk","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/oTyWL9rdA8oPAzsWtxW0Vjz9KYV.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/oTyWL9rdA8oPAzsWtxW0Vjz9KYV.jpg","air_date":"2021-02-05","episode_count":7,"overview":"Eric passou a viver entre realidade e um mundo invisível habitado por seres fantásticos depois que sua esposa morreu - e percebeu que nem tudo é como parece. A série faz um mergulho nas histórias do folclore brasileiro de forma atual e fala sobre o poder das relações humanas.","vote_average":7.4,"episodes":{"1":{"name":"Queria muito que você estivesse aqui","overview":"Arrasado com a morte da esposa, um policial ambiental se envolve no misterioso aparecimento de um boto cor-de-rosa em uma praia do Rio de Janeiro.","air_date":"2021-02-05","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/wrCfvXmtK2LaGWL4RO3clULx0EI.jpg","vote_average":6.5},"2":{"name":"É um caminho sem volta","overview":"Márcia e Eric examinam um cadáver encontrado na floresta. Luna prepara uma armadilha para capturar o Saci. Inês usa seus poderes em Manaus.","air_date":"2021-02-05","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/yV3I8JXmEia6cHObP5oOxvbipCL.jpg","vote_average":8},"3":{"name":"Eles estão entre nós","overview":"Eric e Márcia investigam Inês, mas Ivo quer encerrar o caso. Ciço sugere a Eric que criaturas folclóricas existem. Januária se preocupa com Luna.","air_date":"2021-02-05","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/izXcKemJmxv8nNIpRpKllmA1PEy.jpg","vote_average":6.8},"4":{"name":"A Cuca vai pegar","overview":"Na Floresta do Cedro, Ciço encontra uma cena perturbadora. Eric investiga a surpreendente ligação de sua família com o caso de Manaus. Inês manda Tutu em uma missão.","air_date":"2021-02-05","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/cEAqbN02eKC6TlUNn9JaBUram14.jpg","vote_average":7.3},"5":{"name":"Você não vai acreditar em mim","overview":"Preocupada com o comportamento estranho de Luna, Januária pede ajuda a um curandeiro. Eric faz um ritual com Ciço para se lembrar do encontro com Manaus.","air_date":"2021-02-05","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/9eEOrNSUHbYHT0gUbXOVKRhH42i.jpg","vote_average":7.7},"6":{"name":"Coisa de criança","overview":"Luna convence o Saci a levá-la até o Curupira. Ciço conta a Afonso sobre a maldição do Corpo Seco. Eric e os outros tentam interceptar Luna.","air_date":"2021-02-05","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/zYSFe8y2uVjSRV7JU9NxqO9OM2m.jpg","vote_average":7.7},"7":{"name":"É muito maior do que a gente","overview":"Inês consola o Curupira e Camila vai atrás de Eric, que toma uma atitude extrema para acabar de vez com a maldição.","air_date":"2021-02-05","runtime":33,"still_path":"https://image.tmdb.org/t/p/original/wunjbJ3PDXSPJ6BgotClnrl9MxM.jpg","vote_average":7.7}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/u9bQPxILScuQCZPV1clEYxqFTL8.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/u9bQPxILScuQCZPV1clEYxqFTL8.jpg","air_date":"2023-03-22","episode_count":5,"overview":"Após dois anos ausente, Eric aparece em um santuário natural, protegido por indígenas e procurado por garimpeiros ilegais, perto de Belém do Pará. Ele descobre que Luna e a Cuca estavam morando nas proximidades com o objetivo de trazê-lo de volta à vida. Embora queira retornar imediatamente para o Rio de Janeiro com Luna, suas habilidades sobrenaturais recém-adquiridas o tornam necessário para proteger Luna e o santuário, que descobre serem intimamente ligados.","vote_average":6.7,"episodes":{"1":{"name":"É tudo o que eu mais desejo","overview":"Um crime brutal acontece no coração da floresta amazônica. Luna e Inês partem em uma missão para encontrar Eric. Os serviços de Matinta Perê são requisitados.","air_date":"2023-03-22","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/pqSBYDc3X9d4NdrnF15FNnrewDN.jpg","vote_average":7.5},"2":{"name":"Não vou te fazer mal","overview":"Depois de desfazer a maldição de Bento, Eric usa seus novos poderes para procurar Luna. Débora encontra uma nova chave para Marangatu e promove um leilão muito exclusivo.","air_date":"2023-03-22","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/oFHqdv9Xk2QWGBXIjJ5W8ryyxEM.jpg","vote_average":8},"3":{"name":"A vida que a gente sempre quis","overview":"No cativeiro, Lazo e Luna acabam virando amigos. Eric, Clarice e Inês decidem invadir o leilão secreto de Débora para libertá-los.","air_date":"2023-03-22","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/x8PYPteI15qTg4ph9TIx8BryjQu.jpg","vote_average":6},"4":{"name":"O teu medo é o teu veneno","overview":"Luna vive uma experiência de cura transformadora na floresta. Eric luta para controlar seus poderes cada vez mais fortes.","air_date":"2023-03-22","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/bdFlL8F1kePD5Zmgm4qwcxUPR3e.jpg","vote_average":6},"5":{"name":"Marangatu, a morada do sagrado","overview":"O passado de Débora vem à tona e ela enfrenta Castro. Eric inicia uma jornada angustiante para conseguir se curar.","air_date":"2023-03-22","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/aLeoOvfGjsrBcJxSaIGHfILQfiQ.jpg","vote_average":6}}}}},
