"90929":{"id":"90929","name":"Expedição Selvagem","slug":"expedicao-selvagem","original_title":"Out There with Jack Randall","overview":"Jack Randall, especialista em animais, procura por espécies exóticas e ameaçadas em meio a alguns dos ambientes mais perigosos do planeta.","first_air_date":"2019-07-07","episode_run_time":60,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":6,"created_by":[],"production_companies":["Painless Productions","National Geographic"],"genres":["Documentário"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/xjzz9uLQdZ0xa7BxAXUkT3kKpl0.jpg","poster_path":"https://image.tmdb.org/t/p/original/t2HwXF0XjXpbP96EJ4UMjSBMv2c.jpg","cast":["Jack Randall"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/t2HwXF0XjXpbP96EJ4UMjSBMv2c.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/t2HwXF0XjXpbP96EJ4UMjSBMv2c.jpg","air_date":"2019-07-07","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Caça à Pítons-Fantasmas","overview":"O zoólogo Jack Randall se aventura ao norte na Austrália para encontrar pítons, incluindo a rara Oenpelli, mais conhecida como \"fantasma\", pois poucas pessoas já a viram na natureza; Jack mergulha em pântanos infestados de crocodilos, enfia a mão em tocas de lagartos gigantes, se esquiva da mordida de uma cobra venenosa e rasteja por cavernas escuras e apertadas para encontrar esses predadores ariscos.","air_date":"2019-07-07","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/1Nxy3WXFmj0NJsgLnDsBQ7XX7LC.jpg","vote_average":0},"2":{"name":"A Gangue de Cangurus Selvagens","overview":"O zoólogo de animais selvagens Jack Randall viaja pelo Outback australiano para realizar seu sonho de ser aceito em uma gangue de cangurus selvagens. No meio do caminho, Jack agarra cobras, vai atrás de lagartos, se defende contra dingos perigosos e até resgata um bebê canguru órfão na esperança de ensiná-lo a se cuidar antes de colocá-lo de volta na natureza.","air_date":"2019-07-14","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/fiSGBkRML0eoMv7URmwo47EvlaY.jpg","vote_average":0},"3":{"name":"A Grande Batalha de Crocodilos","overview":"O zoólogo Jack Randall viaja pelo indômito território do norte na Austrália, até a linha de frente da batalha entre duas espécies diferentes de crocodilos mortais; os enormes crocodilos de água salgada estão ocupando o espaço dos seus primos de água doce; Jack ajuda os especialistas e cientistas locais a pegarem e rastrearem esses dinossauros perigosos na esperança de manter o equilíbrio da natureza.","air_date":"2019-07-28","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/4IDLkUevEBxetCSjQN7vX2xGddz.jpg","vote_average":0},"4":{"name":"Frente às Cobras Mais Venenosas do Mundo","overview":"O corajoso zoólogo de animais selvagens Jack Randall explora a remota península de Cape York, Austrália, para confrontar cinco das cobras mais venenosas do mundo, incluindo a esquiva taipan-costeira, uma cobra tão agressiva que alguns especialistas não chegam perto. No meio do caminho, Jack encontra pítons enormes e tarântulas aterrorizantes, e junta forças com uma lenda local para determinar qual é a cobra mais mortal da Austrália.","air_date":"2019-08-04","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/zXslwjBxZ9vpdEpdBKwZEtNTOVE.jpg","vote_average":0},"5":{"name":"O Mistério das Tartarugas Verdes","overview":"O corajoso zoólogo de animais selvagens Jack Randall mergulha de cabeça em um mistério marinho, se as majestosas tartarugas-verdes estão se adaptando às condições devastadoras da Grande Barreira de Corais que está morrendo.","air_date":"2019-08-09","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/6XwqBPPAPavCi54o1ct3CdbXw1c.jpg","vote_average":0},"6":{"name":"Resgate de Animais Abandonados","overview":"A deslumbrante região Centro Vermelho na Austrália tem um grande problema, incontáveis cavalos e camelos, cujos ancestrais foram trazidos para ajudar a explorar este vasto continente, foram abandonados na natureza e agora estão morrendo devido à seca. O zoólogo de animais selvagens Jack Randall se junta a tratadores locais na missão de resgatar o máximo possível de animais e provar que eles ainda podem ajudar as pessoas a sobreviverem neste ambiente implacável e ermo.","air_date":"2019-08-16","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/qevNANMcA3dmfLPaxpjP093SRnz.jpg","vote_average":0}}}}},
