"233254":{"id":"233254","name":"Brawn: Uma História Incrível da F1","slug":"brawn-uma-historia-incrivel-da-f1","original_title":"Brawn: The Impossible Formula 1 Story","overview":"Keanu Reeves conta uma das maiores sagas da história da Fórmula 1. Através da visão de Ross Brawn e de respeitados ícones da corrida, como Jenson Button e Rubens Barrichello, tudo é revelado nesta cativante série de quatro partes. Desde a formação, veja a jornada marcante da Brawn GP através de manobras estratégicas e provações financeiras durante uma época excepcionalmente competitiva dos anais do esporte.","first_air_date":"2023-11-15","episode_run_time":0,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["North One Television"],"genres":["Documentário"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/j6hN6I2LwYu9kZJApvQ8dx6eMCv.jpg","poster_path":"https://image.tmdb.org/t/p/original/84x621Lh65VBok228qUjeX9Xgvd.jpg","cast":["Keanu Reeves","Jenson Button","Ross Brawn","Rubens Barrichello","Christian Horner"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/84x621Lh65VBok228qUjeX9Xgvd.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/84x621Lh65VBok228qUjeX9Xgvd.jpg","air_date":"2023-11-15","episode_count":4,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Parte 1","overview":"Keanu Reeves conta uma das maiores histórias de azarão da Fórmula 1. Depois da crise de 2008, uma equipe independente e com dificuldades financeiras assume a primeira posição. Ross Brawn, o gênio por trás do sucesso da Ferrari, lidera uma aquisição para salvar a equipe Honda. Renomeada como Brawn GP, Ross leva a equipe a se concentrar nas novas regras, auxiliado pela descoberta de um engenheiro. Apesar das adversidades, eles constroem um carro para sua primeira corrida em Melbourne, Austrália.","air_date":"2023-11-15","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/6Gd6ONaOUNRi2bGDhrzzt1GBah7.jpg","vote_average":10},"2":{"name":"Parte 2","overview":"O sucesso na Austrália é agridoce, já que a ascensão da Brawn GP causa tensão entre as equipes que a ajudaram. Jenson supera todas as expectativas, obtendo vitórias incríveis apesar dos ataques incessantes dos maiores nomes do esporte. Longe das pistas, Ross e Nick enfrentam uma batalha judicial de alto risco que pode pôr fim aos seus sonhos de campeonato. Enquanto o campeonato esquenta, a Brawn se vê em meio a uma confusão política, com sua sobrevivência por um fio.","air_date":"2023-11-15","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/iwKHJ8MoCgUWk7GlSw3dlILwtnG.jpg","vote_average":10},"3":{"name":"Parte 3","overview":"Os ânimos fervem, uma revolução é arquitetada entre as equipes, lutando contra regras injustas e distribuição desigual de recursos financeiros. Ameaçando iniciar sua própria série, elas desafiam a ordem da Fórmula 1. Em meio ao alvoroço, Jenson encara um obstáculo. Seu carro tem dificuldades no frio, o que fere sua confiança e as esperanças para o campeonato, enquanto pilotos rivais aproveitam oportunidades. A tensão aumenta na Brawn GP quando Rubens Barrichello surge como competidor formidável.","air_date":"2023-11-15","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/f0KHMM9fpAIFxcQptG1Y9UcDwlC.jpg","vote_average":10},"4":{"name":"Parte 4","overview":"A equipe enfrenta má sorte no GP japonês. A RedBull domina, a corrida crucial no Brasil chega com Jenson perdendo as rédeas do campeonato. Seu colega de equipe, Rubens, e Vettel, da RedBull, vislumbram a vitória, e Jenson luta para se classificar. A última corrida se torna uma batalha entre três pilotos. Acompanhe a luta de Jenson pela vitória com o apoio inabalável de seu pai e uma estratégia genial de sua equipe. Será que eles vão conseguir transformar esse pesadelo num fim de conto de fadas?","air_date":"2023-11-15","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/sinQhVIT5DARjUbwrBsyDzCN88m.jpg","vote_average":10}}}}},
